import styled from "styled-components";

const Father = styled.div`
  display: flex;
`;

const Box = styled.div`
  background-color: ${(props) => props.bgColor};
  width: 100px;
  height: 100px;
`;

//Box의 모든 속성들을 들고 온 다음 추가적으로
const Circle = styled(Box)`
  border-radius: 50px;
`;

const App = () => {
  return <Father></Father>;
};

export default App;
